// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "../contracts/IHederaTokenService.sol";

/**
 * @title IndexVault
 * @dev Treasury contract for the index token, handling token custody and composition logic
 */
contract IndexVault {
    // Constants
    address public constant HTS_PRECOMPILE = 0x0000000000000000000000000000000000000167;

    // Token addresses
    address public indexToken;

    // Contract references
    address public controller;
    address public admin;

    // Composition management
    struct Asset {
        address token;
        uint16 weight; // in basis points (e.g., 5000 = 50%)
    }
    Asset[] public composition;

    // User deposits tracking
    mapping(address => mapping(address => uint256)) public deposits; // user => token => amount

    // HTS interaction
    IHederaTokenService private hts;

    // Events
    event DepositReceived(address indexed user, address indexed token, uint256 amount);
    event TokensDistributed(address indexed user, uint256 amount);
    event CompositionUpdated(Asset[] composition);
    event IndexTokenSet(address indexed tokenAddress);

    // Errors
    error OnlyController();
    error OnlyAdmin();
    error TokenNotAssociated(address token, address account);
    error InsufficientDeposit(address token, uint256 required, uint256 actual);
    error TransferFailed(address token, int64 responseCode);
    error InvalidComposition();

    modifier onlyController() {
        if (msg.sender != controller) {
            revert OnlyController();
        }
        _;
    }

    modifier onlyAdmin() {
        if (msg.sender != admin) {
            revert OnlyAdmin();
        }
        _;
    }

    /**
     * @dev Constructor to initialize the vault
     * @param _controller Address of the IndexTokenController that can call this vault
     */
    constructor(address _controller) {
        controller = _controller;
        admin = msg.sender;
        hts = IHederaTokenService(HTS_PRECOMPILE);
        indexToken = address(0);
    }

    /**
     * @dev Set the index token address - can only be called once
     * @param _indexToken The address of the index token
     */
    function setIndexToken(address _indexToken) external onlyController {
        require(_indexToken != address(0), "Cannot set to zero address");
        require(indexToken == address(0), "Index token already set");

        indexToken = _indexToken;
        emit IndexTokenSet(_indexToken);
    }

    /**
     * @dev Set the composition of the index - which tokens and their weights
     * @param _composition Array of assets and their weights in basis points
     */
    function setComposition(Asset[] calldata _composition) external onlyAdmin {
        // Validate that weights sum to 10000 (100%)
        uint256 totalWeight = 0;
        for (uint i = 0; i < _composition.length; i++) {
            totalWeight += _composition[i].weight;

            // Ensure each token is associated with this contract
            if (!hts.isTokenAssociated(address(this), _composition[i].token)) {
                int64 associateResponse = hts.associateToken(address(this), _composition[i].token);
                if (associateResponse != 0) {
                    revert TransferFailed(_composition[i].token, associateResponse);
                }
            }
        }

        if (totalWeight != 10000) {
            revert InvalidComposition();
        }

        // Clear existing composition
        if (composition.length > 0) {
            delete composition;
        }

        // Set new composition
        for (uint i = 0; i < _composition.length; i++) {
            composition.push(_composition[i]);
        }

        emit CompositionUpdated(_composition);
    }

    /**
     * @dev Validates if a user can mint the specified amount based on their deposits
     * @param user The user address to check
     * @param amount The amount of index tokens to mint
     * @return Whether the user can mint the specified amount
     */
    function validateMint(address user, uint256 amount) external view returns (bool) {
        // Short circuit if composition isn't set
        if (composition.length == 0) {
            return false;
        }

        // Check user has sufficient deposits for each asset in the composition
        for (uint i = 0; i < composition.length; i++) {
            Asset memory asset = composition[i];
            uint256 requiredAmount = (amount * asset.weight) / 10000;

            if (deposits[user][asset.token] < requiredAmount) {
                return false;
            }
        }

        return true;
    }

    /**
     * @dev Receive minted tokens from controller and distribute to user
     * @param user The user to receive the tokens
     * @param amount The amount of tokens to distribute
     */
    function receiveMint(address user, uint256 amount) external onlyController {
        require(indexToken != address(0), "Index token not set");

        // Verify the user has provided sufficient deposits
        for (uint i = 0; i < composition.length; i++) {
            Asset memory asset = composition[i];
            uint256 requiredAmount = (amount * asset.weight) / 10000;

            if (deposits[user][asset.token] < requiredAmount) {
                revert InsufficientDeposit(asset.token, requiredAmount, deposits[user][asset.token]);
            }

            // Deduct the deposit - tokens stay in vault
            deposits[user][asset.token] -= requiredAmount;
        }

        // Transfer the minted index tokens to the user
        if (!hts.isTokenAssociated(user, indexToken)) {
            revert TokenNotAssociated(indexToken, user);
        }

        int64 transferResult = hts.transferToken(indexToken, address(this), user, amount);
        if (transferResult != 0) {
            revert TransferFailed(indexToken, transferResult);
        }

        emit TokensDistributed(user, amount);
    }

    /**
     * @dev Deposit backing assets into the vault
     * @param token The token address to deposit
     * @param amount The amount to deposit
     */
    function depositAsset(address token, uint256 amount) external {
        require(amount > 0, "Amount must be greater than zero");

        // Check if token is part of composition
        bool isValidToken = false;
        for (uint i = 0; i < composition.length; i++) {
            if (composition[i].token == token) {
                isValidToken = true;
                break;
            }
        }
        require(isValidToken, "Token not part of composition");

        // Ensure tokens are associated with this contract
        if (!hts.isTokenAssociated(address(this), token)) {
            revert TokenNotAssociated(token, address(this));
        }

        // Transfer tokens from user to vault
        int64 transferResult = hts.transferToken(token, msg.sender, address(this), amount);
        if (transferResult != 0) {
            revert TransferFailed(token, transferResult);
        }

        // Update user's deposit record
        deposits[msg.sender][token] += amount;

        emit DepositReceived(msg.sender, token, amount);
    }

    /**
     * @dev Calculate required deposit amounts for minting a specific amount of index tokens
     * @param amount The amount of index tokens to mint
     * @return tokens Array of token addresses required
     * @return amounts Array of required amounts for each token
     */
    function calculateRequiredDeposits(uint256 amount) 
        external 
        view 
        returns (address[] memory tokens, uint256[] memory amounts) 
    {
        tokens = new address[](composition.length);
        amounts = new uint256[](composition.length);

        for (uint i = 0; i < composition.length; i++) {
            tokens[i] = composition[i].token;
            amounts[i] = (amount * composition[i].weight) / 10000;
        }

        return (tokens, amounts);
    }

    /**
     * @dev Get user's deposit for a specific token
     * @param user The user address to check
     * @param token The token address to check
     * @return The amount of the token deposited by the user
     */
    function getDeposit(address user, address token) external view returns (uint256) {
        return deposits[user][token];
    }

    /**
     * @dev Update controller address - for future upgrades
     * @param newController The new controller address
     */
    function updateController(address newController) external onlyAdmin {
        require(newController != address(0), "Cannot set to zero address");
        controller = newController;
    }

    /**
     * @dev Update admin address - for future DAO governance
     * @param newAdmin The new admin address
     */
    function updateAdmin(address newAdmin) external onlyAdmin {
        require(newAdmin != address(0), "Cannot set to zero address");
        admin = newAdmin;
    }

    /**
     * @dev Get composition info
     * @return Full composition array
     */
    function getComposition() external view returns (Asset[] memory) {
        return composition;
    }

    // Allow contract to receive HBAR
    receive() external payable {}
}

app/contracts/MockHederaTokenService.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "./IHederaTokenService.sol";

/**
 * @title MockHederaTokenService
 * @dev Mock implementation of the Hedera Token Service for testing
 */
contract MockHederaTokenService is IHederaTokenService {
    // Mock state
    mapping(address => bool) private supplyKeys;
    mapping(address => mapping(address => bool)) private tokenAssociations;
    mapping(address => uint256) private tokenBalances;
    mapping(address => mapping(address => mapping(address => uint256))) private allowances;
    mapping(address => int64) private transferResults;
    mapping(address => HederaToken) private tokenDetails;

    // Mock response codes
    int64 private mockedCreateTokenResponseCode;
    address private mockedCreateTokenAddress;

    // Mock events
    event TokenCreated(address tokenAddress, int64 responseCode);
    event TokenMinted(address token, uint256 amount, int64 responseCode);
    event TokenTransferred(address token, address from, address to, uint256 amount, int64 responseCode);
    event TokenAssociated(address token, address account, int64 responseCode);

    constructor() {
        // Initialize with success response
        mockedCreateTokenResponseCode = 0;
        mockedCreateTokenAddress = address(0);
    }

    /**
     * @dev Set up test tokens
     */
    function setupTokens(
        address tokenAddress,
        address sauceTokenAddress,
        address clxyTokenAddress,
        address userAddress
    ) external override {
        // Associate tokens with this contract
        tokenAssociations[tokenAddress][address(this)] = true;
        tokenAssociations[sauceTokenAddress][address(this)] = true;
        tokenAssociations[clxyTokenAddress][address(this)] = true;

        // Associate tokens with user
        tokenAssociations[tokenAddress][userAddress] = true;
        tokenAssociations[sauceTokenAddress][userAddress] = true;
        tokenAssociations[clxyTokenAddress][userAddress] = true;
    }

    /**
     * @dev Set supply key holder for a token
     */
    function setSupplyKeyHolder(address token, address holder) external {
        supplyKeys[holder] = true;
    }

    /**
     * @dev Set the mocked create token response
     */
    function setMockedCreateTokenResponse(int64 responseCode, address tokenAddress) external override {
        mockedCreateTokenResponseCode = responseCode;
        mockedCreateTokenAddress = tokenAddress;
    }

    /**
     * @dev Create a new token
     */
    function createToken(
        HederaToken memory token,
        uint256 initialTotalSupply,
        uint8[] memory keys,
        address[] memory keyAddresses
    ) external payable override returns (int64 responseCode, address tokenAddress) {
        // Return mocked response if set
        if (mockedCreateTokenResponseCode != 0) {
            emit TokenCreated(mockedCreateTokenAddress, mockedCreateTokenResponseCode);
            return (mockedCreateTokenResponseCode, mockedCreateTokenAddress);
        }

        // Generate a deterministic address if none set
        tokenAddress = mockedCreateTokenAddress == address(0) 
            ? address(uint160(uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender)))))
            : mockedCreateTokenAddress;

        // Store token details
        tokenDetails[tokenAddress] = token;

        // Associate token with treasury
        tokenAssociations[tokenAddress][token.treasury] = true;
        emit TokenAssociated(tokenAddress, token.treasury, 0);

        // Set initial balance
        if (initialTotalSupply > 0) {
            tokenBalances[token.treasury] = initialTotalSupply;
            emit TokenMinted(tokenAddress, initialTotalSupply, 0);
        }

        // Store keys
        for (uint i = 0; i < keys.length; i++) {
            if (keys[i] == 4) { // Supply key type
                supplyKeys[keyAddresses[i]] = true;
            }
        }

        // Associate token with this contract
        tokenAssociations[tokenAddress][address(this)] = true;
        emit TokenAssociated(tokenAddress, address(this), 0);

        // Associate token with the controller
        tokenAssociations[tokenAddress][msg.sender] = true;
        emit TokenAssociated(tokenAddress, msg.sender, 0);

        emit TokenCreated(tokenAddress, 0);
        return (0, tokenAddress);
    }

    /**
     * @dev Check if an account has the supply key for a token
     */
    function isSupplyKey(address token, address account) external view override returns (bool) {
        return supplyKeys[account];
    }

    /**
     * @dev Associate a token with an account
     */
    function associateToken(address account, address token) external override returns (int64) {
        // Check if already associated
        if (tokenAssociations[token][account]) {
            return -1; // Already associated
        }

        tokenAssociations[token][account] = true;
        emit TokenAssociated(token, account, 0);
        return 0; // Success
    }

    /**
     * @dev Disassociate a token from an account
     */
    function disassociateToken(address account, address token) external override returns (int64) {
        tokenAssociations[token][account] = false;
        return 0; // Success
    }

    /**
     * @dev Mint tokens
     */
    function mintToken(address token, uint256 amount, bytes[] memory) external override returns (int64) {
        tokenBalances[msg.sender] += amount;
        emit TokenMinted(token, amount, 0);
        return 0; // Success
    }

    /**
     * @dev Burn tokens
     */
    function burnToken(address token, uint256 amount, bytes[] memory) external override returns (int64) {
        if (tokenBalances[msg.sender] < amount) {
            return -1; // Insufficient balance
        }
        tokenBalances[msg.sender] -= amount;
        return 0; // Success
    }

    /**
     * @dev Get token allowance
     */
    function allowance(address token, address owner, address spender) external view override returns (uint256) {
        return allowances[token][owner][spender];
    }

    /**
     * @dev Get token balance
     */
    function balanceOf(address token, address account) external view override returns (uint256) {
        return tokenBalances[account];
    }

    /**
     * @dev Transfer tokens
     */
    function transferToken(address token, address sender, address recipient, uint256 amount) external override returns (int64) {
        int64 result = transferResults[token];
        if (result != 0) {
            return result;
        }

        if (tokenBalances[sender] < amount) {
            return -1; // Insufficient balance
        }

        tokenBalances[sender] -= amount;
        tokenBalances[recipient] += amount;

        emit TokenTransferred(token, sender, recipient, amount, 0);
        return 0; // Success
    }

    /**
     * @dev Check if a token is associated with an account
     */
    function isTokenAssociated(address token, address account) external view override returns (bool) {
        return tokenAssociations[token][account];
    }

    /**
     * @dev Set token association status (for testing)
     */
    function setTokenAssociation(address token, address account, bool isAssociated) external {
        tokenAssociations[token][account] = isAssociated;
    }

    /**
     * @dev Set token balance (for testing)
     */
    function setBalance(address token, address account, uint256 balance) external override {
        tokenBalances[account] = balance;
    }

    /**
     * @dev Set token allowance (for testing)
     */
    function setAllowance(address token, address owner, address spender, uint256 amount) external override {
        allowances[token][owner][spender] = amount;
    }

    /**
     * @dev Set transfer result (for testing)
     */
    function setTransferResult(address token, int64 result) external override {
        transferResults[token] = result;
    }

    /**
     * @dev Clear transfer results (for testing)
     */
    function clearTransferResults() external override {
        // Clear all transfer results
        for (uint i = 0; i < 100; i++) { // Arbitrary limit to prevent gas issues
            address token = address(uint160(i));
            delete transferResults[token];
        }
    }

    /**
     * @dev Get token details
     */
    function getTokenInfo(address tokenAddress) external view returns (HederaToken memory) {
        return tokenDetails[tokenAddress];
    }
}

