// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./IHederaTokenService.sol";

contract SimpleTokenMinter {
    address private constant HTS_PRECOMPILE = address(0x0000000000000000000000000000000000000167);
    IHederaTokenService private hts;

    // Store token address for minting
    address public tokenAddress;

    event MintSuccessful(address token, uint256 amount, int64 responseCode);
    event TokenSet(address previousToken, address newToken);
    event MintAttempt(address token, uint256 amount);
    event MintError(string reason, bool success);

    constructor() {
        hts = IHederaTokenService(HTS_PRECOMPILE);
    }

    // Allow the contract to receive HBAR
    receive() external payable {}

    // Set the token address
    function setTokenAddress(address _tokenAddress) external {
        address previousToken = tokenAddress;
        tokenAddress = _tokenAddress;
        emit TokenSet(previousToken, _tokenAddress);
    }

    // Mint tokens - requires this contract to be the supply key
    function mintTokens(int64 amount) external {
        require(tokenAddress != address(0), "Token address not set");
        require(amount > 0, "Amount must be greater than 0");

        // Convert to uint256 and emit event before attempting mint
        uint256 mintAmount = uint256(uint64(amount));
        emit MintAttempt(tokenAddress, mintAmount);

        // Create empty metadata array
        bytes[] memory metadata = new bytes[](0);

        // Direct call to precompile with simplified approach
        (bool success, bytes memory result) = HTS_PRECOMPILE.call(
            abi.encodeWithSelector(
                IHederaTokenService.mintToken.selector,
                tokenAddress,
                mintAmount,
                metadata
            )
        );

        require(success, "Precompile call failed");

        // Decode response code
        int64 responseCode = abi.decode(result, (int64));

        emit MintSuccessful(tokenAddress, mintAmount, responseCode);

        require(responseCode == 0, "Mint failed");
    }

    // Mint tokens - Direct HTS precompile approach
    function mintTokensRaw(uint64 amount) external {
        require(tokenAddress != address(0), "Token address not set");
        require(amount > 0, "Amount must be greater than 0");

        // Log the attempt
        emit MintAttempt(tokenAddress, amount);

        // Encode arguments for mintToken(address token, uint64 amount, bytes[] memory metadata)
        bytes[] memory metadata = new bytes[](0);
        bytes memory encodedParams = abi.encodeWithSelector(
            IHederaTokenService.mintToken.selector,
            tokenAddress,
            amount,
            metadata
        );

        // Make low-level call to HTS precompile
        (bool success, bytes memory result) = HTS_PRECOMPILE.call(encodedParams);

        // Check for call success first
        if (!success) {
            emit MintError("Precompile call failed", success);
            revert("Precompile call failed");
        }

        // Decode the response code if the call was successful
        int64 responseCode = abi.decode(result, (int64));

        // Log the outcome
        emit MintSuccessful(tokenAddress, amount, responseCode);

        // Check response code (0 = SUCCESS)
        if (responseCode != 0) {
            emit MintError(string(abi.encodePacked("Mint failed with code: ", responseCode)), success);
            revert("Mint failed");
        }
    }

    // Get token balance of this contract
    function getTokenBalance() external view returns (uint256) {
        require(tokenAddress != address(0), "Token address not set");

        return hts.balanceOf(tokenAddress, address(this));
    }
}

